import "./leftnav.css";

export default function LeftNav() {
  return ( 
      <div className="leftnav">
        <div className="logo">GPT Assist</div>
        <div className="nav">

        <ul>
  <li>Coffee</li>
  <li>Tea</li>
  <li>Milk</li>
</ul>


        </div>
        </div>  

  );
}
